import React from "react";
import './sub-component css/Projects_content.css';

function Projects_content() {
    return(
        <>
            <div className="projects-content-body">
                <div className="projects-content-box1"></div>
                <div className="projects-content-box2"></div>
            </div>
        </>
    );
}
export default Projects_content;
